    /* basic height setup */
    html,
    body {
      height: 100%;
      overflow: hidden;

      font-family:
        'Pretendard Variable',
        Pretendard,
        -apple-system,
        BlinkMacSystemFont,
        system-ui,
        Roboto,
        'Helvetica Neue',
        'Segoe UI',
        'Apple SD Gothic Neo',
        'Noto Sans KR',
        'Malgun Gothic',
        'Apple Color Emoji',
        'Segoe UI Emoji',
        'Segoe UI Symbol',
        sans-serif;
    }

    .no-child-shrink>* {
      flex-shrink: 0;
    }

    /* #page-content {
	@apply flex flex-col;
} */

    /* default font */
    :root [data-theme='wintry'] {
      /* --theme-font-family-base: 'Noto Sans KR', sans-serif; */
      /* --theme-font-family-heading: 'Noto Sans KR', sans-serif; */
    }

    .no-select {
      -webkit-touch-callout: none;
      /* iOS Safari */
      -webkit-user-select: none;
      /* Safari */
      /* Konqueror HTML */
      -moz-user-select: none;
      /* Old versions of Firefox */
      /* Internet Explorer/Edge */
      user-select: none;
      /* Non-prefixed version, currently
                                  supported by Chrome, Edge, Opera and Firefox */
    }

    /* ============= Shadow ============= */
    .ElevationUp-4 {
      box-shadow: 0px -40px 40px 0px rgba(50, 50, 50, 0.32);
    }

    .Elevation-4 {
      box-shadow:
        0px 8px 40px 0px rgba(123, 119, 166, 0.12),
        0px 12px 12px 0px rgba(123, 119, 166, 0.04),
        0px 8px 4px -1px rgba(123, 119, 166, 0.04);
    }

    .Elevation-3 {
      box-shadow:
        0px 2px 8px 0px rgba(123, 119, 166, 0.08),
        0px 4px 16px 0px rgba(123, 119, 166, 0.08),
        0px 4px 12px -2px rgba(123, 119, 166, 0.16);
    }

    /* ============= Scrollbar ============= */

    /* Hide scrollbar for IE, Edge and Firefox */
    .hide-scrollbar {
      -ms-overflow-style: none;
      scrollbar-width: none;
    }

    .hide-scrollbar::-webkit-scrollbar {
      display: none;
      width: 0;
    }

    .show-scrollbar {
      scrollbar-width: thin;
      scrollbar-color: black white;
    }

    /* 스크롤바 전체 기본 꾸미기 */
    .show-scrollbar::-webkit-scrollbar {
      width: 5px;
    }

    /* 스크롤바 막대 꾸미기 */
    .show-scrollbar::-webkit-scrollbar-thumb {
      background: gray;
      /* 스크롤바 막대 색상 */
      /* 스크롤바 막대 테두리 설정  */
      /* border: 2px solid gray;  */
      /* border-radius: 12px 12px 12px 12px; */
    }

    /* 스크롤바 트랙 꾸미기 */
    .show-scrollbar::-webkit-scrollbar-track {
      background: #9b6a2f;
    }

    .dark .hover\:variant-soft:hover {

    .dark .hover\:bg-primary-hover-token:hover:hover {
      background-color: rgb(var(--color-primary-500) / 0.1);

    .hover\:variant-soft:hover {
      background-color: rgb(var(--color-surface-400) / 0.2);
      --tw-ring-offset-shadow: var(--tw-ring-inset) 0 0 0 var(--tw-ring-offset-width) var(--tw-ring-offset-color) !important;
      --tw-ring-shadow: var(--tw-ring-inset) 0 0 0 calc(0px + var(--tw-ring-offset-width)) var(--tw-ring-color) !important;
      box-shadow: var(--tw-ring-offset-shadow), var(--tw-ring-shadow), var(--tw-shadow, 0 0 #0000) !important;
      color: rgb(var(--color-surface-700));
    }

    .dark .hover\:variant-soft:hover {
      color: rgb(var(--color-surface-200));
    }

    :is(.dark .hover\:variant-soft:hover) {
      background-color: rgb(var(--color-surface-500) / 0.2);
